func findHighAccessEmployees(access_times [][]string) []string {
    employeeAccessMap := make(map[string][]int)
    for _, access := range access_times {
        employee, timeStr := access[0], access[1]
        hours, _ := strconv.Atoi(timeStr[:2])
        minutes, _ := strconv.Atoi(timeStr[2:])
        totalMinutes := hours*60 + minutes
        employeeAccessMap[employee] = append(employeeAccessMap[employee], totalMinutes)
    }

    var highAccessEmployees []string
    highAccessCheck := make(map[string]bool)

    for employee, times := range employeeAccessMap {
        sort.Ints(times)
        for i := 0; i < len(times)-2; i++ {
            if times[i+2]-times[i] < 60 {
                if !highAccessCheck[employee] {
                    highAccessEmployees = append(highAccessEmployees, employee)
                    highAccessCheck[employee] = true
                    break
                }
            }
        }
    }

    return highAccessEmployees
}
